import React, {Component} from 'react';
// import "../style/css-final.css";
import "../style/bootstrap.min.css";
import { Link } from "react-router-dom";
// import Search from './search';
import { actions, store } from "../store";
import { withRouter } from "react-router-dom";
import { connect } from "unistore/react";
import "../style/shop.css"
import axios from 'axios';

class CartFromProduct extends Component{
    render(){
        console.log("PRODUCT di LOOPING")
        return(
            <React.Fragment>
                <div className="col-md-3 product">
                    <h1>{this.props.terserah}</h1>
                    <Link to={`/`}>
                        <img className="image-product" src={this.props.image_cart} alt=""/>
                    </Link>
                    <p className="name-product">{this.props.name_product_cart}</p>
                    <p className="title-rating">Rate</p>
                    <p className="weight-product">{this.props.weight_cart} gr</p>
                    <p className="rating-product">(1/10)</p>
                    <p className="seller-product">Hedy</p>
                    <p className="stock">stock: </p>
                    <p className="stock-product">2</p>
                    <div>
                        <p className="price">Rp. {this.props.price_cart} /</p>
                        <p className="reference">{this.props.reference_cart}</p>
                    </div>
                    {/* <img className="halal" src={require("../image/halal.png")} alt=""/> */}
                    {this.props.halal_cart ?
                        (<img className="halal" src={require("../image/halal.png")} alt=""/>):(<img className="nohalal" src={require("../image/nohalal.png")} alt=""/>)
                    }
                </div>
            </React.Fragment>
        );
    }
}

export default connect("", actions)(withRouter(CartFromProduct));
